import React from 'react';
import './Nav.css';

function Nav() {
    return (
        <div className="nav">
        <img src="data:image/png;base64," 
            alt="Netflix logo"
            className="nav__logo"/>
        <img src="https://i.pinimg.com/564x/b6/77/cd/b677cd1cde292f261166533d6fe75872.jpg" alt="" className="nav__avatar"/>

        </div>
    )
}

export default Nav
